import React from "react";
import "./style.css";

function CharacterCard(props) {
  return (
    <div className="card">
      <div className="img-container">
        <img alt={props.id} src={props.image} />
        <div onClick={() => props.getClicked=(props.id)}>
          CLICK ME!
        </div>
      </div>
    </div>
  );
}

export default CharacterCard;

